    "terrain-mitchell-county-ia",nt"isopen": false,nt"url": null,nt"notes":
    "Terrain data, as defined in FEMA Guidelines and Specifications, Appendix M: Data
    Capture Standards, describes the digital topographic data that was used to create
    the elevation data representing the terrain environment of a watershed and/or floodplain.
    Terrain data requirements allow for flexibility in the types of information provided
    as sources used to produce final terrain deliverables. Once this type of data is
    provided, FEMA will be able to account for the origins of the flood study elevation
    data. (Source: FEMA Guidelines and Specifications, Appendix M, Section M.4).",nt"license_title":
